import React, { useContext } from "react";
import "./Nav.css";

import logoMobile from "../../assets/images/logo-white.svg";
import logoDesktop from "../../assets/images/logo-pink.svg";
import { Link } from "react-router-dom";
import { UserContext } from "../../context/AuthContext";

const Nav = ({ exibeNavbar, setExibeNavbar }) => {
  const { userData } = useContext(UserContext);

  // console.log(`EXIBE O MENU? ${exibeNavbar}`);

  return (
    <nav className={`navbar ${exibeNavbar ? "exibeNavbar" : ""}`}>
      <span
        className="navbar__close"
        onClick={() => {
          setExibeNavbar(false);
        }}
      >
        x
      </span>

      <Link to="/" className="eventlogo">
        <img
          className="eventlogo__logo-image"
          src={window.innerWidth >= 992 ? logoDesktop : logoMobile}
          alt="Event Plus Logo"
        />
      </Link>

      <div className="navbar__items-box">
        <Link to="/" className="navbar__item">
          Home
        </Link>

        {userData.nome && userData.role}

        <Link className="navbar__item" to="/tipo-eventos">
          Tipos de Evento
        </Link>

        <Link className="navbar__item" to="/eventos">
          Eventos
        </Link>
        <Link></Link>
        {/* <Link  className='navbar__item' to="/login">Login</Link> */}
        {/* <Link  className='navbar__item' to="/testes">Testes</Link> */}
      </div>
    </nav>
  );
};

export default Nav;
